import PropTypes from 'prop-types';

const CopyTelegramId = props => {
    return (
        <div>
            <h2 className='text-2xl font-medium text-gray-800 mb-0'>Copy Telegram ID</h2>
            <p className='text-gray-700 lg:text-xl mb-14'>Copy your Telegram ID after starting the bot</p>
        </div>
    );
};

CopyTelegramId.propTypes = {};

export default CopyTelegramId;
